INSERT INTO `product` VALUES (1,'Nước hoa Chanel Chance EDP Mang nét mềm mại, tinh khiết như những giọt sương ban mai, Hương thơm của Chanel Chance EDP phảng phất hòa trong gió và len lỏi vào từng ký ức, tạo ra ánh sáng lung linh, huyền ảo. Tưởng chừng vô hình mà hữu hình khiến cho mọi xúc cảm tự thăng hoa.','Nước hoa Chanel Chance EDP',100,1,1,1),(2,'Với mùi hương của nước hoa nữ Chanel Chance Eau Tendre khi lan tỏa ra xung quanh sẽ chinh phục mọi không gian bằng vẻ đẹp dịu dàng tinh tế. Mùi hương của nó gợi lên sự trong trẻo, nhẹ nhàng, đi đến đâu nó sẽ mang đến cho mọi người hương hoa thơm ngát của mùa xuân hè rực rỡ.','Nước Hoa Chanel Chance Eau Tendre EDT',100,1,1,1),(3,'Nước Hoa Chanel Coco Mademoiselle là một phiên bản bổ sung cho nét tính cách đầy tương phản của Gabrielle Chanel. Đó là biểu hiện cho nét nữ tính, một hương thơm sinh động, tươi mát và phức cảm dành cho những phụ nữ thanh lịch và quý phái.','Nước Hoa Chanel Coco Mademoiselle EDP',100,1,1,2),(4,'Chắc hẳn dòng nước hoa Coco mademoiselle EDP của Chanel không còn quá xa lạ với chị em phụ nữ yêu nước hoa, hầu như ai cũng thích mùi hương sang chảnh và quyến rũ này. Ra mắt từ năm 2001 và Coco mademoiselle edp luôn giữ top đầu trong danh sách những mùi hương mà chị em yêu thích.','Nước Hoa Nữ Chanel Coco Mademoiselle Intense EDP',100,1,1,2),(5,'Nước hoa Chanel Coco Noir là 1 sản phẩm mới của dòng nước hoa Chanel được thừa hưởng cả 2 nét đẹp rạng rỡ và nồng ấm từ Coco Mademoiselle và Coco eau de parfum.','Nước hoa Chanel Coco Noir ',100,1,1,2),(6,'Đứng đầu danh sách này là một mùi hương đã được sử dụng từ lâu và là mùi rất đặc trưng, được xem như biểu tượng cho nước hoa Gucci nữ. Với mùi hương nguyên chất là tổng hợp của các tông mùi gỗ đặc trưng của đàn hương và cam bergamot, thêm một chút thanh mát từ quả mâm xôi chắc hẳn sẽ làm những người xung quanh bạn phải chú ý ngay đến sự có mặt của bạn vì mùi hương quyến rũ này.','Gucci Guilty Pour Femme',100,1,2,1),(7,'Gucci đã rất tinh tế khi đã sản xuất ra những sản phẩm nước hoa Gucci nam có những mùi hương độc đáo thích hợp để sử dụng trong mọi hoàn cảnh, nước hoa Gucci guilty nam là một trong những loại nước hoa hàng hiệu dành cho nam có được thời gian lưu hương lâu nhất và được phái mạnh ưa chuộng nhất qua nhiều năm.','Gucci Guilty for men',100,1,2,1),(8,'Có thể nói đây là loại nước hoa được chăm chút đến từng chi tiết nhỏ nhất vì sản phẩm này được sản xuất riêng cho người hoàng gia là công chúa của Monac, cũng chính vì thế không quá ngạc nhiên khi đây là nước hoa nữ được ưa chuộng nhất và được tìm kiếm nhiều nhất tại trang web Gucci Việt Nam. Hoa mộc lan là nữ hoàng của những loài hoa, với mùi hương thanh tao và một chút hoang dã của loài hoa tự nhiên mở đầu cho một buổi tiệc hương thơm của hương vỏ cam, hương thảo mộc mát lạnh hòa quyện với cơ thể của bạn suốt cả một ngày dài.','Flora By Gucci Glamorous Magnolia',100,1,2,1),(9,'Tuy rằng đây là một sản phẩm nước hoa nam Gucci thế nhưng điều đặc biệt là gây nên sự chú ý của các chị em phụ nữ và là một trong những nước hoa yêu thích nhất của các nàng. Không quá khó hiểu vì sự hấp dẫn này, với mùi hương cỏ dại và những loại gỗ tự nhiên đã làm tăng sự nam tính, hấp dẫn của người đàn ông, thích hợp cho những chàng trai mạnh mẽ, có cá tính độc lập yêu thích sự hoang dã. Mùi hương cá tính đặc biệt sẽ làm phái nữ bị quyến rũ và tập trung sự chú ý vào bạn. ','Gucci Guilty Absolute for men',100,1,2,2),(10,'Nằm trong dòng sản phẩm nước hoa nữ của Gucci thế nhưng nó lại hoàn toàn đặc biệt với phần còn lại. Có rất ít các nước hoa authentic sử dụng hương ổi trong sản phẩm của mình thế nhưng Gucci đã tinh tế để hương ổi là bậc đầu tiên của ba tầng hương thơm để kích thích khứu giác và sau đó là những mùi hương dịu dàng, nữ tính của xạ hương, mật ong... cũng chính vì thế đã tạo nên sản phẩm nước hoa nữ thơm nhất. Chắc chắn sẽ làm hài lòng phái nữ cũng như cánh mày râu.','Vial Gucci By Gucci EDP for women',100,1,2,2),(11,'Nước hoa CK One ra mắt lần đầu tiên vào năm 1994 và đặc biệt dùng được cho cả nam và nữ. Trong giai đoạn những năm 90s, sản phẩm trở thành tượng đài mới của giới trẻ. Bởi hương thơm tươi mát, nhẹ nhàng lan tỏa trên cơ thể, mang đến một cảm giác thật gần gũi và thoải mái. ','Nước hoa Calvin Klein One EDT',100,1,3,2),(12,'Lấy cảm hứng từ những lý tưởng về tình yêu vĩnh cửu và mãnh liệt. Nước hoa Eternity For Women như một bài thánh ca. Mang theo những điều đặc biệt của tình yêu thương, gia đình và hoà bình. Chai nước hoa CK nữ này được sáng tạo bởi Sophia Grojsman vào năm 1988.','Nước hoa CK Eternity For Women EDP',100,1,3,2),(13,'Eternity Aqua for Women được Calvin Klein ra mắt vào năm 2012, thuộc nhóm mùi hương hoa tươi mát (Floral – Aquatic). Là một phiên bản mới mẻ của Eternity 1988. Eternity Aqua for Women được mô tả là một mùi hương hiện đại. Nó sẽ ôm lấy bạn và biến bạn trở nên thanh lịch, quyến rũ và đầy bí ẩn.','Nước Hoa Nữ CK Eternity Aqua EDP',100,1,3,2),(14,'Nước hoa Calvin Klein Deep Euphoria EDP không chỉ ghi dấu ấn với các cô gái bằng hương thơm gợi cảm tinh tế mà còn chính bởi thiết kế màu sắc đẹp lạ. Người phụ nữ Deep Euphoria vẫn được tỏa sáng và sành điệu, nhưng cô ấy cũng được trao quyền và tươi trẻ hơn một chút. Với thông điệp “Phụ nữ Calvin Klein tự tin, khiêu khích và phóng khoáng, phụ nữ Deep Euphoria thể hiện tất cả những khía cạnh này với một lớp phiêu lưu bổ sung.”','Nước Hoa Calvin Klein Deep Euphoria EDP',100,1,3,1),(15,'Calvin Klein Eternity for Men Eau de Parfum ra mắt vào tháng 9 năm 2019. Nó như một phiên bản mới của hương thơm Eternity for Men 1989 gốc. Thương hiệu sử dụng các cụm từ như “mạnh mẽ nhưng tinh tế” và “nam tính nhưng gợi cảm” để mô tả hương thơm mới đầy sống động của chai nước hoa CK nam này.','Nước Hoa CK Eternity For Men EDT',100,1,3,1),(16,'Nước hoa Dior Jadore EDP được nhiều khách hàng đánh giá là dòng nước hoa mang hương thơm quyến rũ nhất của thương hiệu Dior. Sản phẩm này mang mùi hương mềm mại vừa đủ, không quá nồng ấm nhưng cũng không quá tươi mát.','Nước hoa Dior Jadore EDP',100,1,4,1),(17,'Nước hoa Dior mini này cũng sở hữu 3 tầng hương rõ rệt, khởi đầu là mùi hương thanh tao, nồng nhẹ của chanh vàng, quýt hồng và hồng tiêu. Sang đến tầng hương thứ hai lại cực kỳ ngọt ngào với hương hoa jồng Grasse, lá hoa nhài và hoa hồng Đan Mạch. ','Nước hoa Miss Dior Eau De cho nữ giới',90,1,4,1),(18,'Sản phẩm được bào chế lấy cảm ứng từ thời trang cao cấp dành cho phái đẹp nên sở hữu thiết kế vô cùng nữ tính với chiếc nơ buộc trên phần cổ. Chất liệu bao bì là thuỷ tinh dày dặn, cao cấp khi cầm cho cảm giác vô cùng chắc tay.','Nước hoa Dior Blooming Bouquet',100,1,4,2),(19,'Nước hoa Dior nam này được thiết kế dưới dạng chai hình trụ tròn với tông màu chủ đạo là xanh đen đầy nam tính, mạnh mẽ và bí ẩn. Tầng hương đầu của Dior Sauvage là sự tươi mát của cam bergamot và một chút nồng nàn của tiêu. ','Nước hoa Dior Sauvage EDP',100,1,4,2),(20,'Khả năng tỏa hương của nước Dior nữ này mặc dù không quá xa, chỉ trong vòng bán kính 1 cánh tay nhưng độ lưu hương thì khá tốt từ 3 - 6 giờ đồng hồ. ','Nước hoa Dior JOY EDP ',100,1,4,1),(21,'Sản phẩm là sự kết hợp hài hòa hương thơm của hoa nhài và hương thơm từ trái đào và kẹo hoa hồng. Với thành phần này giúp cho sản phẩm bí ẩn đến lạ kỳ góp phần tôn lên vẻ đẹp duyên dáng và gợi cảm cho các cô nàng khi sử dụng.','Nước Hoa Nữ Burberry My Burberry Black Parfum',100,1,5,1),(22,'Lấy cảm hứng từ màu xanh tươi mát của những khu vườn sau cơn mưa và hình ảnh chiếc áo gió cổ điển, nước hoa My Burberry EDP được sản xuất.','Nước Hoa My Burberry EDP Cho Nữ',100,1,5,1),(23,'Nước Hoa Nữ Burberry My Burberry Blush EDP sở hữu hương thơm mới, ra mắt vào năm 2017. Thiết kế theo phong cách nữ tính, tự tin, mạnh mẽ với tông màu chủ đạo là màu hồng. Chi tiết ấn tượng nhất là một cái nắp bật lửa sáng bóng với cảm hứng từ nút áo khoác Burberry và điểm thêm một chiếc khăn thắt nơ quanh cổ chai.','Nước Hoa Burberry My Burberry Blush EDP Cho Nữ',100,1,5,2),(24,'Dòng nước hoa này được ví như một bức tranh mùa thu nhỏ tại thành phố London. Thiết kế chai đơn giản, kiểu dáng là hình chữ nhật được bọc lớp vải có hoa văn độc quyền của thương hiệu Burberry. Nắp chai có hình khối được sản xuất bằng chất liệu có màu bạc kết hợp với một chút lớp thủy tinh trong ở phần đáy giúp sản phẩm sáng lấp lánh vô cùng thu hút.','Nước Hoa Nữ Burberry London For Women',100,1,5,2),(25,'The Beat lấy cảm hứng từ album âm nhạc của Kasabian. Sản phẩm được thiết kế nhẹ nhàng bởi được cong uốn lượn với tông màu hồng pastel rất nữ tính và cuốn hút.','Nước Hoa Nữ Burberry The Beat',100,1,5,2),(26,'Dòng nước hoa Louis Vuitton California Dream ra mắt vào năm 2020 được lấy cảm hứng từ các khoảnh khắc mùa hè rực rỡ. Những nốt hương hòa trộn giữa các thành phần quýt, lê, xạ hương,… đặc trưng Phương Đông, mang lại sự ấm áp, nồng nàn khắc hoạ vẻ đẹp hoàng hôn đầy cuốn hút. ','Nước hoa Louis Vuitton california dream 100ml',100,1,6,1),(27,'Louis Vuitton Contre Moi là hương nước hoa được ra mắt vào năm 2016 với hương hoa cỏ hướng đến những người trẻ ở lứa tuổi trên 25. Nước hoa Louis Vuitton Contre Moi được chiết xuất từ cam bergamot, chanh vàng, thảo mộc, hoa mộc lan, hương vani,… mang đến hương thơm tinh tế, nhẹ nhàng. ','Nước hoa Louis Vuitton Contre Moi',100,1,6,1),(28,'Nước hoa Louis Vuitton Afternoon Swim với hương thơm đặc trưng từ cam sicily, cam bergamot và quýt mang lại cảm giác tự nhiên, tươi mát. Bên cạnh đó, các nốt hương từ nước hoa Louis Vuitton còn đem đến cảm giác sảng khoái, tràn đầy năng lượng, đầy âm hưởng mùa hè. ','Nước hoa Louis Vuitton Afternoon Swim',100,1,6,2),(29,'Được ra mắt cùng năm với Contre Moi, Louis Vuitton Rose Des Vents được xem là dòng nước hoa nữ được yêu thích nhất mọi thời đại. Sản phẩm được lấy cảm hứng từ hoa hồng – biểu tượng của sắc đẹp, tình yêu và sự vĩnh cửu đồng thời mang đến sự thanh lịch và đẳng cấp. Hương thơm lãng mạn của nhóm hoa cỏ kết hợp cùng với mùi hương cơ thể giúp nàng tạo nên sự gợi cảm, quyến rũ đặc biệt. ','Nước hoa Louis Vuitton Rose Des Vents',100,1,6,2),(30,'Dòng nước hoa nam cao cấp Louis Vuitton Les Sables Roses được lấy cảm hứng từ sự đối lập giữa thời tiết nóng nực ban ngày và lạnh lẽo ban đêm tại miền sa mạc đầy cát. Sự hòa quyện giữa hương hoa hồng và gỗ trầm hương đậm chất phương Đông sẽ khiến bạn phải ngây ngất, say mê.','Nước hoa Louis Vuitton Les Sables Roses',100,1,6,1),(31,'Versace Man Eau Fraiche được miêu tả như một chàng thanh niên nam tính, đầy sự tự tin với hương vị biển cả tươi mát. Ra mắt vào năm 2006, gây ấn tượng với thiết kế mát mắt, tinh tế cùng mùi hương sảng khoái lịch lãm.','Nước hoa Versace Man Eau Fraiche',100,1,7,1),(32,'Versace Eros gây ấn tượng mạnh mẽ cho phái mạnh bởi vẻ đẹp cổ điển trong cả thiết kế và mùi hương. Lấy cảm hứng từ thần tình yêu trong thần thoại Hy Lạp, Versace Eros là mùi hương đại diện cho niềm đam mê và khao khát tình yêu mãnh liệt.','Nước hoa Versace Eros',100,1,7,1),(33,'Ra mắt vào năm 2008, Versace Pour Homme đại diện cho những người đàn ông hiện đại, giàu tri thức. Với hương thơm thảo mộc Pour Homme thể hiện nét nam tính ẩn sâu trong tâm hồn chứ không nồng nàn dễ nhận biết như Versace Eros. Đây là một trong những dòng nước hoa thơm được yêu thích nhất của Versace.','Nước hoa Versace Pour Homme',100,1,7,2),(34,'Chuyển biến từ thiết kế mát mẻ của các dòng nước hoa trước sang một nét trầm ấm bí ẩn đã giúp Versace Oud Noir thu hút được rất nhiều sự yêu thích. Là hương nước hoa của nhóm gỗ phương Đông, Versace Oud Noir lấy cảm hứng từ hình ảnh mặt trời lặn trên sa mạc, tĩnh lặng nhưng đầy cuốn hút.','Nước hoa Versace Oud Noir',100,1,7,2),(35,'Lạnh lùng và hấp dẫn là hai từ dùng để miêu tả nước hoa Versace Blue Jeans, với thiết kế độc đáo chưa từng có ở bất kỳ hãng nước hoa nào đã gây được ấn tượng mạnh mẽ tới khách hàng và được săn đón nhiệt tình vào những năm 90.','Nước hoa Versace Blue Jeans',100,1,7,1),(36,'Mùi hương đặc trưng: Terre D’Hermes đặc trưng với hương khởi đầu là cam, bưởi nhẹ nhàng, tươi mát. Lớp hương giữa cay nồng, ấm áp. Trong khi đó, lớp hương cuối đọng lại mùi gỗ tuyết tùng mang đến trải nghiệm đầy hứng khởi.','Nước hoa Terre D’Hermes',100,1,8,2),(37,'Mùi hương đặc trưng: Hermes Eau Des Merveilles mang một mùi hương khá dịu nhẹ với hương cam, bưởi tươi mát khởi đầu; lớp hương giữa ấm áp đậm mùi hổ phách, tiêu và lớp hương cuối cùng là tinh chất gỗ tuyết tùng, cỏ hương bài, rêu sồi đầy sảng khoái.','Nước hoa Hermes Eau Des Merveilles',100,1,8,2),(38,'Mùi hương đặc trưng: Twilly D’Hermes mang đến những nốt hương hoa cỏ đầy tinh tế. Đó là mùi hương của hoa cam, hoa huệ, hoa nhài,  vanilla, gỗ đàn hương hòa quyện với nhau, đầy cuốn hút.','Nước hoa Twilly D’hermes 30ml',100,1,8,1),(39,'Mùi hương đặc trưng: Eau Des Merveilles Bleue mang đến cho bạn cảm giác rất sảng khoái với mùi hương của biển cả và núi rừng, đồng thời, hòa quyện trong đó còn là hương gỗ, cây hoắc hương vô cùng tươi mới.','Nước hoa Hermes Eau Des Merveilles Bleue',100,1,8,1),(40,'Mùi hương đặc trưng: Dòng 24 Faubourg khởi đầu là mùi hương của cam, đào, ngọc lan tây, dạ hương lan. Hương giữa là sự hòa quyện của các loài hoa diên vĩ, cam, iris, nhài và cây sơn chi. Ở tầng hương cuối, bạn sẽ cảm nhận được mùi hương gỗ, vanilla.','Nước hoa Hermes 24 Faubourg',100,1,8,1),(41,'Yves Saint Laurent Libre là dòng nước hoa YSL nữ được ra mắt vào năm 2019. Sản phẩm của hợp tác hoàn hảo giữa hai chuyên gia nước hoa: Anne Flipo và Carlos Benaim. Thiết kế của Libre gây ấn tượng mạnh mẽ về tính độc đáo, sang trọng và vô cùng tinh tế. ','Nước hoa YSL Libre Eau de Parfum',100,1,9,1),(42,'Nước hoa Yves Saint Laurent Black Opium ra mắt vào năm 2014. Với sự kết hợp của các chuyên gia nước hoa đại tài. Honorine Blanc, Marie Salamagne, Nathalie Lorson và Olivier Cresp nổi tiếng thế giới. Hương thơm bí ẩn, huyền ảo là hiện thân của các cô nàng hiện đại, cá tính. Dám nghĩ, dám làm, không ngại thể hiện cái tôi khác biệt của mình.','Nước hoa Yves Saint Laurent Black Opium Eau de Parfum',100,1,9,1),(43,'Ra mắt vào đầu năm 2017, nước hoa YSL Mon Paris Eau De Toilette được ví như một sự “lột xác” của phiên bản EDP nổi tiếng trước đó. Mùi hương của YSL Mon Paris là sự hòa trộn ngọt ngào giữa gia vị của tình yêu và cảm xúc. Một làn nước hoa nhẹ nhàng đầy bay bổng, bao quanh trên cơ thể bạn.','Nước hoa Yves Saint Laurent Mon Paris Eau de Toilette',100,1,9,2),(44,'Nước hoa Yves Saint Laurent Black Opium Floral Shock được YSL cho ra mắt vào tháng 2 năm 2017. Với sự góp mặt của những chuyên gia nước hoa hàng đầu như: Honorine Blanc, Marie Salamagne, Nathalie Lorson, Olivier Cresp. Yves Saint Laurent Black Opium Floral Shock cũng là phiên bản Black Opium mới nhất của hãng thuộc nhóm hoa quả thực phẩm mới lạ. Hương thơm Black Opium Floral Shock dành riêng cho những cô nàng điệu đà nhưng vẫn lý trí và mạnh mẽ.','Nước hoa YSL Black Opium Floral Shock Eau de Parfum',100,1,9,2),(45,'Năm 2018 mang đến một dấu mốc đầy bất ngờ bởi sự trở lại đầy mạnh mẽ của dòng nước hoa Yves Saint Laurent nổi tiếng. Với siêu phẩm YSL Black Opium Eau De Toilette. So với phiên bản đầu tiên vào năm 2015, YSL Black Opium 2018 tỏ ra vượt trội hơn hẳn. Gây ấn tượng với nét ma mị, quyến rũ, vô cùng đặc trưng của mình. Sự kết hợp giữa cấu trúc mùi hương mới mẻ cùng diện mạo lộng lẫy, sang trọng.','Nước hoa YSL Black Opium Eau De Toilette ',100,1,9,2),(46,'Về thiết kế: vỏ hộp có bề mặt đính hạt kim tuyến phản chiếu ánh sáng vô cùng lấp lánh và nổi bật. Mẫu chai mang phong cách thiết kế hơi hướng cổ điển của những năm 1949 với tông màu chủ đạo là hồng nhạt và chất liệu từ thủy tinh.','Nước hoa Lancome La Vie Est Belle',100,1,10,2),(47,'Về thiết kế: sử dụng gam màu tím vô cùng quyến rũ và đằm thắm, cùng với đó là một lớp bột màu hồng nhạt bên ngoài giúp phản chiếu và tôn lên sự mê hoặc huyền bí của màu tím.','Nước hoa Lancome Tresor Midnight Rose',100,1,10,2),(48,'Về thiết kế: có sự đặc sắc và lôi cuốn ngay từ ánh nhìn đầu tiên nhờ khả năng chuyển màu từ gam hồng phấn sang hồng nhạt. Các đường cong của chai vô cùng mềm mại và nữ tính cùng với điểm nhấn bông hồng satin màu đen vô cùng nổi bật.','Nước hoa Lancome Tresor in Love',100,1,10,1),(49,'Có mùi hương ấm áp, tươi mát và nồng nàn của hoa cỏ.','Nước hoa Lancome Poeme',100,1,10,1),(50,'Sử dụng tông màu thạch anh tím và có kiểu dáng thể hiện vẻ đẹp của người phụ nữ Nhật trong trang phục truyền thống Kimono.','Nước hoa Lancome Hypnose',100,1,10,1);
